export default function MultiZoneRenderer({ zones }) {
  return (
    <div className="relative w-full h-full bg-black">
      {zones.map(zone => (
        <div
          key={zone.id}
          className="absolute overflow-hidden"
          style={{
            left: `${zone.x}%`,
            top: `${zone.y}%`,
            width: `${zone.width}%`,
            height: `${zone.height}%`
          }}
        >
          <ZonePlayer playlistId={zone.playlistId} />
        </div>
      ))}
    </div>
  );
}
